Peru's Cocaine Trail

Sociopolitical Documentary hosted by Sue Lloyd-Roberts, published by BBC broadcasted as part of BBC Our World series in 2013 - English narration


Information
------------------------------

Peru has overtaken Colombia as the world's largest supplier of cocaine. Sue Lloyd-Roberts follows the drug's trail from the coca plant in the Amazon jungle to the young &quot;mules&quot; who try to smuggle it out of the country to consumers in Europe. The majority of them succeed but many of them languish in Peruvian prisons or, having completed their sentences, are stranded in Peru unable to buy their way home.

